import './App.css';
import {useState, useMemo, useCallback} from 'react'
import Header from './components/Header';


function App() {
  const [number, setNumber] = useState(0);

  const increment = useCallback(() => {
    setNumber((prevState) => prevState())
  }, [])  
  return (
    <div className="App">
      <Header increment={increment}/>
      <hr />
      <h1>{number}</h1>
    </div>
  );
}

export default App;
